    /// <summary>
    /// Helper class to retrieve Point array based on data that in our internal usage caused rendering performance problems
    /// </summary>
    class NoisyData
    {
        /// <summary>
        /// Read data from csv file and return as Point array
        /// csv file is assumed to have 5 entries per line, seperated by commas, where first is a x value, and next 4 values are y values
        /// </summary>
        /// <returns></returns>
        public static Point[,] GetMultiPlotDataFromCsv(string path)
        {
            bool preserveXValues = false; //ignore x values from file and give simpler, sequence numbers as xVal

            int numPlots = 4; //hard-coded to match data file
            using (var sr = new System.IO.StreamReader(path))
            {
                #region Count number of points in file
                int linesRead = 0;
                while (sr.ReadLine() != null)
                    linesRead++;
                sr.BaseStream.Position = 0;
                sr.DiscardBufferedData();
                #endregion Count number of points in file

                var points = new Point[numPlots, linesRead];
                double xVal = 0;
                for (int i = 0; i < linesRead; i++)
                {
                    string[] nums = sr.ReadLine().Split(',');

                    xVal = (preserveXValues) ? double.Parse(nums[0]) : i;
                    for (int j = 0; j < numPlots; j++)
                        points[j, i] = new Point(xVal, double.Parse(nums[1 + j]));
                }
                return points;
            }
        }

