        /// <summary>
        /// Alternative to Data from CSV File
        /// Return simple Point array from the Geometry XAML strings above
        /// </summary>
        /// <returns></returns>
        public static Point[,] GetMultiPlotData()
        {
            //Ignore the M and L (move and line) commands, and just return the vertices
            int numPoints = plot3_PathGeometryXaml.Split(new char[] { ' ', 'L', 'M' }, StringSplitOptions.RemoveEmptyEntries).Length;
            var points = new Point[4, numPoints];

            int i = 0, j = 0;
            foreach (string geoXaml in new string[] { plot1_PathGeometryXaml, plot2_PathGeometryXaml, plot3_PathGeometryXaml, plot4_PathGeometryXaml })
            {
                string[] xamlPoints = geoXaml.Split(new char[]{' ', 'L', 'M'}, StringSplitOptions.RemoveEmptyEntries);
                for (j = 0; j < numPoints && j < xamlPoints.Length; j++)
                {
                    string[] xyPair = xamlPoints[j].TrimStart(new char[] { 'M', 'L' }).Split(',');
                    points[i, j] = new Point(double.Parse(xyPair[0]), double.Parse(xyPair[1]));
                }
                System.Diagnostics.Debug.WriteLine(string.Format("Parsed {0} points for ch {1}", j + 1, i + 1));
                i++;
            }
            return points;
        } 
